class Solution(object):
  def findAllConcatenatedWordsInADict(self, words):
    """
    :type words: List[str]
    :rtype: List[str]
    """
    d = Dictionary()
    for word in words:
      if word:
        d.add(word)
    result = set()
    d.travel(d.root, result)
    return [node.toword() for node in result]

class Node(object):

  def __init__(self, c, parent=None):
    self.parent = parent
    self.c = c
    self.children = {}
    self.end = False

  def toword(self):
    node = self
    tmp = []
    while node.parent:
      tmp.append(node.c)
      node = node.parent
    return ''.join(reversed(tmp))


class Dictionary(object):

  def __init__(self):
    self.root = Node(None)
    self.stack = [set()]

  def add(self, word):
    node = self.root
    for c in word:
      if c not in node.children:
        node.children[c] = Node(c, parent=node)
      node = node.children[c]
    node.end = True

  def travel(self, node, result):
    if node.end:
      for shadow in self.stack[-1]:
        if shadow.end:
          result.add(node)
          break
      self.stack[-1].add(self.root)
    for c, child in node.children.iteritems():
      s = set()
      for shadow in self.stack[-1]:
        cand = shadow.children.get(c, None)
        if cand:
          s.add(cand)
          if cand.end:
            s.add(self.root)
      self.stack.append(s)
      self.travel(child, result)
      self.stack.pop()

